import { useNavigate } from "react-router-dom";

const AIInsights = () => {

  const navigate = useNavigate();

  const onLogOutClick = () => {
    navigate("/");
  };

  const onNewChatClick = (message) => { 
    navigate("/ai-insights");
  };

  const onLearningMeaningDifferentPhrases = () => {
    navigate("/learning-the-meaning-of-different-phrases")
  };

  const onRedFlagsClick = () => {
    navigate("/red-flags")
  }; 

  const onCommunicatePersonalityClick = () => {
    navigate("/communicating-with-a-certain-personality-page")
  };

  function newBlueBubble() {
    var msg = document.getElementById("userinput").value
    return (
